/*!50003 CREATE*/ /*!50017 DEFINER=`a`@`localhost`*/ /*!50003 TRIGGER serialStatusRedeem AFTER INSERT ON RedeemNote
    FOR EACH ROW
    BEGIN
        DECLARE done INT DEFAULT 0;
        DECLARE serialId BIGINT(19);
        DECLARE cur1 CURSOR FOR SELECT serial_id FROM Pawn WHERE pawnNote_id=NEW.pawnNote_id;
        DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = 1;
        OPEN cur1;
            read_loop: LOOP
                FETCH cur1 INTO serialId;
                IF done THEN
                    LEAVE read_loop;
                END IF;
                UPDATE Serial SET  status=103 WHERE id=serialId;
            END LOOP;
        CLOSE cur1;
    END */;;
DELIMITER ;
