/*!50003 CREATE*/ /*!50017 DEFINER=`a`@`localhost`*/ /*!50003 TRIGGER acBalanceSync AFTER INSERT ON Split
    FOR EACH ROW
    BEGIN
        UPDATE Ac SET balance=balance-NEW.amt WHERE id=NEW.ac1_id;
        UPDATE Ac SET balance=balance+NEW.amt WHERE id=NEW.ac2_id;
        SELECT cAc_id INTO @cAcId FROM Trans WHERE id=NEW.trans_id;
        IF  NEW.ac1_id=1 AND NEW.ac2_id=12 OR NEW.ac1_id=1 AND NEW.ac2_id=45 THEN
		 UPDATE CAc SET savingBal=savingBal+NEW.amt WHERE id=@cAcId;
        ELSEIF NEW.ac1_id=12 AND NEW.ac2_id=1  OR NEW.ac1_id=45 AND NEW.ac2_id=1 THEN
		 UPDATE CAc SET savingBal=savingBal-NEW.amt WHERE id=@cAcId;
        ELSEIF NEW.ac1_id=12 AND NEW.ac2_id=10 THEN           
			UPDATE CAc SET loan=loan+NEW.amt WHERE id=@cAcId;
			SELECT noteId, status INTO @noteId, @status FROM Trans WHERE id=NEW.trans_id;
            IF @status=-5 THEN
				UPDATE PawnNote SET due=due+NEW.amt WHERE id=@noteId;
				DELETE FROM RedeemNote WHERE pawnNote_id=@noteId;
			END IF;            
        ELSEIF NEW.ac1_id=10 AND NEW.ac2_id=12 OR NEW.ac1_id=10 AND NEW.ac2_id=45  THEN
		 SELECT noteId INTO @noteId FROM Trans WHERE id=NEW.trans_id;
		 UPDATE PawnNote SET due=due-NEW.amt WHERE id=@noteId;
		 UPDATE CAc SET loan=loan-NEW.amt WHERE id=@cAcId;
        ELSEIF NEW.ac1_id=45 AND NEW.ac2_id=10 THEN                 
		 UPDATE CAc SET loan=loan+NEW.amt WHERE id=@cAcId;
        ELSEIF NEW.ac1_id=4 AND NEW.ac2_id=12 OR NEW.ac1_id=4 AND NEW.ac2_id=45  THEN
		 UPDATE CAc SET shareValue=shareValue+NEW.amt WHERE id=@cAcId;
        ELSEIF NEW.ac1_id=12 AND NEW.ac2_id=4 OR NEW.ac1_id=45 AND NEW.ac2_id=4  THEN   
		 UPDATE CAc SET shareValue=shareValue-NEW.amt WHERE id=@cAcId;
		ELSEIF  NEW.ac1_id=12 AND NEW.ac2_id=48 OR NEW.ac1_id=45 AND NEW.ac2_id=48 THEN
		 UPDATE CAc SET od=od+NEW.amt WHERE id=@cAcId;
        ELSEIF NEW.ac1_id=48 AND NEW.ac2_id=12  OR NEW.ac1_id=48 AND NEW.ac2_id=45 THEN
		 UPDATE CAc SET od=od-NEW.amt WHERE id=@cAcId;
        END IF;
    END */;;
